<OA3>
	<ServerBased>
		<KeyProviderServerLocation>
			<IPAddress>192.168.1.13</IPAddress>
			<ProtocolSequence>ncacn_ip_tcp</ProtocolSequence>
			<EndPoint>9011</EndPoint>
			<Options></Options>
		</KeyProviderServerLocation>
		<Parameters>
			<Parameter name="LicensablePartNumber" value="KW9-00001" />
			<Parameter name="OEMPONumber" value="01042022-1" />
			<OEMOptionalInfo>
				<Field>
					<Name>ZPC_MODEL_SKU</Name>
					<Value>%COMPUTERNAME%</Value>
				</Field>
				<Field>
					<Name>ZFRM_FACTOR_CL1</Name>
					<Value>Desktop</Value>
				</Field>
				<Field>
					<Name>ZFRM_FACTOR_CL2</Name>
					<Value>Standard</Value>
				</Field>
				<Field>
					<Name>ZSCREEN_SIZE</Name>
					<Value>0.0</Value>
				</Field>
				<Field>
					<Name>ZTOUCH_SCREEN</Name>
					<Value>Non-touch</Value>
				</Field>
			</OEMOptionalInfo>
			<SerialNumber>%COMPUTERNAME%</SerialNumber >
			<BusinessID>4646</BusinessID>
		</Parameters>
	</ServerBased>
	<OutputData>
		<AssembledBinaryFile>C:\OA3.bin</AssembledBinaryFile>
		<ReportedXMLFile>C:\OA3.xml</ReportedXMLFile>
	</OutputData>
</OA3>